import React from 'react';
import Icons from "../components/Icons/Icons";
import classes from "../css/Index.module.css";
import Text from "../components/Text/Text";

const Index = () => {
    return (

        <div className={classes.frontPage}>
            <Text/>
            <Icons/>
        </div>
    );
};


export default Index;
